import React from "react";
import { MDBAnimation } from "mdbreact";

const AnimationPage = () => {
    return (
        <MDBAnimation type="bounce" infinite>
       
                      <small style={{color:"white",fontSize:"1rem",padding:"1rem"}}>X Recursion</small>
                  
        </MDBAnimation>
    );
};

export default AnimationPage;
